import React from 'react'

const information = () => {
    return (
        <div className='information pt6'>
            <div className="container">
                <div className="col-sm 4">
                    <input type="file" class="custom-file-input" id="inputGroupFile01"></input>
                    
                </div>
            </div>
        </div>
    )
}

export default information
